      if (this.state.redirect){
          return <Redirect to='/cadastro'/>
      }
    };

    render() {
        return (
            <React.Fragment>
                {this.renderRedirect()}
                <section className="sobre">
                    <div className="container-sobre">
                        <h1 className="sobre-titulo">PlayerStars et dapibus tortor mollis justo accumsan, ac varius ante luctus. Quisque blandit ipsum sit amet urna.</h1>
